import { useState, useEffect } from 'react'
import "./Cars.css"
import CarInstance from './CarInstance'
import { fetch_data } from "../../utils/api";

type Car = {
  strMark: string;
  strPrice: string;
  strImagePath: string;
}  

export const Cars = () => {
  const [cars, setCars] = useState<Car[]>([]);

  useEffect(() => {
    fetch_data('/car/getAll', 'GET')
      .then(data => setCars(data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div className="car-container my-4">
      <div className="row row-cols-3 gy-4 car-list" id="car-list">

        {cars.map((car, index) => (
          <CarInstance
            key={index}
            strMark={car.mark}
            strPrice={car.strPrice}
            strImagePath={car.image}
          />
        ))}

      </div>
    </div>
  );
}
